import '../styles/App.css';
import AppContent from './AppContent';
import PricesData from './PricesData';
import AmountsData from './AmountsData.js';
import Navbar from './view/Navbar.js';
import Header from './view/Header';
import LoginForm from './auth/LoginForm.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import WelcomeContent from './WelcomeContent.js';

function App() {

  const [isLoggedIn, setILoggedIn] = useState(!!localStorage.getItem('token'));

  return (

    <Router>
      <div class="container-fluid" >
        <Header pageTitle="Zestawienie danych na temat cen mieszkaÅ„ w okresie ostatnich 10 lat"></Header>
        <Navbar isLoggedIn={isLoggedIn} />
        <div className="row">
          <div className="col">
            <Routes>
              <Route path="/" element={<AppContent />} />
              <Route path="/prices" element={<PricesData />} />
              <Route path="/amounts" element={<AmountsData />} />
              <Route path="/login" element={<LoginForm />} />
              <Route path="/welcome" element={<WelcomeContent />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>

  );
}

export default App;
